import React, { useState, useEffect } from 'react';

export default function Pop() {
  const [showPop, setShowPop] = useState(false);

  useEffect(() => {
    const timeout = setTimeout(() => {
      setShowPop(true);
    }, 5000);

    return () => clearTimeout(timeout);
  }, []);

  const handleSubmit = (e) => {
    e.preventDefault();
    setShowPop(false);
  };

  return (
    <>
      {showPop && (
        <div className='bg-warning text-dark d-flex justify-content-center p-4 '>
          <div className='mt-3'>
            <h3 className='mb-3'>How do you rate My Profile</h3>
            <div className='d-flex inline-flex rate justify-content-center'>
              {[1, 2, 3, 4, 5].map((star) => (
                <div key={star} className='border border-danger border-4 rounded-5 me-3'>
                  {star}
                </div>
              ))}
            </div>
            <form onSubmit={handleSubmit}>
              <div className='mb-2'>
                <label className='form-label'>Review</label>
                <textarea
                  className='form-control border-0 border-bottom border-1 border-warning rounded-0'
                  placeholder='Write your review here'
                  required
                ></textarea>
                <div className='mb-3 d-flex justify-content-center'>
                  <button type='submit' className='rounded-4 px-4 mt-2'>
                    Submit your review
                  </button>
                </div>
              </div>
            </form>
          </div>
        </div>
      )}
    </>
  );
}
